import React from 'react'
import { Route, Routes } from 'react-router-dom'
import Moder from '../pages/ModerLogin'
import ModerLogin from '../pages/ModerLogin'

export default function Main() {
    return (
        <div>
            <Routes>
                <Route path='/' element={<ModerLogin />} />
            </Routes>
        </div>
    )
}
